import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.scss';
import Home from './components/home';
import Header from './components/header';

function App() {
  return (
    <div className="App">

      <BrowserRouter>

        <Header />

        <Routes>
          <Route path="/" element={<Home />} />
        </Routes>

      </BrowserRouter>

    </div>
  );
}

export default App;
